import "./App.css";
import React, { useState } from "react";
import Auth from "./Auth";
import Home from "./Home";
import { Route, Link } from "react-router-dom"

function App() {

    return (
        <div className="app">
			<Route exact to="/" component={Home}/>
			<Route exact to="/" component={Auth}/>
            <Auth/>
        </div>
    );
}

export default App;
